import "./Post.css";
import {Avatar} from "@material-ui/core";

function Post() {
    return (
        <div className="post">
           <div className="post__top">
                <Avatar 
                src = "" 
                className= "post__avatar"/>
           </div> 
           <div className="post__topInfo">

           </div>
           <div className="post__bottom">

           </div>
        </div>
    )
}

export default Post
